import React from "react";
import {HeaderDesign} from '../Styles/Style';
import logo from '../assets/logo.png';

const Header = () => {

  return (
            <HeaderDesign>
                <ImageHeader src={logo}/>
          </HeaderDesign>
  )
}

export default Header;
